import React from "react";
import bg from "../images/bg2.jpg";

const Home = () => {
  return (
    <>
      <div className="parent">
        <nav></nav>
        <div
          className="intro-banner"
          style={{
            backgroundImage: `linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)),url(${bg})`,
            backgroundRepeat: "no-repeat",
            backgroundSize: "cover",
            backgroundPosition: "center",
          }}
        >
          <section className="quote-section">
            <h3>
              <span>Save upto 80% on Car Insurance.</span>
            </h3>
            <div className="quote-form">
              <h6>I am looking for Car Insurance</h6>
              <div className="number-plate-box">
                <input type="text" placeholder="Enter Number Plate (KXX XXX)" />
                <input type="submit" value="View Quotes" />
              </div>
              <hr />
              <div className="no-number-plate-box">
                <button>Proceed without Number Plate</button>
              </div>
            </div>
          </section>
        </div>
      </div>
    </>
  );
};

export default Home;
